using namespace std;
typedef pair<int,int> ii;
class Solution {
public:
    unordered_map<int, vector<int>> m;
    vector<bool> vis;
    queue<ii> q;
    inline bool foo(const vector<int> &arr, const int &v, const int &d) {
        if (v==arr.size()-1) return 1;
        if (vis[v]) return 0;
        vis[v]=1; q.emplace(v,d);
        return 0;
    }
    inline int minJumps(const vector<int>& arr) {
        if (arr.size()==1) return 0;
        for (int u=0; u<arr.size(); ++u) m[arr[u]].push_back(u);
        q.emplace(0,0); vis.assign(arr.size(),0); vis[0]=1;
        while (q.size()) {
            auto &[u,d] = q.front(); ++d;
            const auto &al = m[arr[u]];
            for (auto v=al.rbegin(); v!=al.rend(); ++v) if (foo(arr,*v,d)) return d;
            if (foo(arr,u+1,d) || (u && foo(arr,u-1,d))) return d;
            q.pop();
        }
        return 0;
    }
};
